import React from "react";
import EventsList from "../components/EventsList";

const dummyEvents = [
  { id: "e1", title: "event1 ", date: "01/01/2024", image: null },
  { id: "e1", title: "event1 ", date: "01/01/2024", image: null },
  { id: "e1", title: "event1 ", date: "01/01/2024", image: null },
  { id: "e1", title: "event1 ", date: "01/01/2024", image: null },
];

const EventsPage = () => {
  return (
    <>
      <EventsList events={dummyEvents} />
    </>
  );
};

export default EventsPage;
